import * as React from "react";
import Svg, {
  Defs,
  Image,
  Mask,
  G,
  Use,
  ClipPath,
  Rect,
  Pattern,
} from "react-native-svg";
/* SVGR has dropped some elements not supported by react-native-svg: filter */ const SimpleDesk =
  (props) => (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="157px"
      height="200px"
      viewBox="0 0 157 200"
      {...props}
    >
      <Defs>
        <Image
          id="image12"
          width={157}
          height={200}
          xlinkHref="data:image/png;base64,"
        />
        <Mask id="mask0">
          <G filter="url(#alpha)">
            <Use xlinkHref="#image12" />
          </G>
        </Mask>
        <Image
          id="image7"
          width={2003}
          height={2489}
          xlinkHref="data:image/png;base64,"
        />
        <ClipPath id="clip2">
          <Rect x={0} y={0} width={172} height={278} />
        </ClipPath>
        <G id="surface8" clipPath="url(#clip2)">
          <Use
            xlinkHref="#image7"
            transform="matrix(0.0874011,0,0,0.111692,-1.532167,0)"
          />
        </G>
        <Pattern
          id="pattern0"
          patternUnits="userSpaceOnUse"
          width={172}
          height={278}
          patternTransform="matrix(1.00318,0,0,1,-7.773438,-40)"
        >
          <Use xlinkHref="#surface8" />
        </Pattern>
        <ClipPath id="clip1">
          <Rect x={0} y={0} width={157} height={200} />
        </ClipPath>
        <G id="surface11" clipPath="url(#clip1)">
          <Rect
            x={0}
            y={0}
            width={157}
            height={200}
            style={{ fill: "url(#pattern0)", stroke: "none" }}
          />
        </G>
      </Defs>
      <G id="surface2">
        <Use xlinkHref="#surface11" mask="url(#mask0)" />
      </G>
    </Svg>
  );
export default SimpleDesk;
